import { ref } from 'vue';

export const TableBean = {
  data() {
    return {
      selectedRow: ref(null),
    };
  },
  methods: {
    rowSelectListener() {
      console.log(this.selectedRow.value);
      const methods = this.$options.methods;
      for (const methodName in methods) {
        const method = methods[methodName];
        if (method?.[Symbol.for('rowSelect')]) {
          method[Symbol.for('rowSelect')]();
        }
      }
    },
  },
};
